import React from 'react';
import AccountNav from '../layout/AccountNav';

const randomValue = (max = 10000, min = 0) => {
  min = Math.ceil(min);
  minNum = min.toFixed(2);
  max = Math.floor(max);
  maxNum = max.toFixed(2);
  return Math.random.toFixed() * (maxNum - minNum) + minNum;
};

export const Account = () => {
  return (
    <div>
      <AccountNav />
      <div className='container'>
        <h1>Account Balance - {randomValue()}</h1>
      </div>
    </div>
  );
};

export default Account;
